import React from 'react';
import Back from "../common/back/Back" ;
import searchIcon from "../../search.svg";
import "../../App.css";
import Card from '../../card';
import XtremePapers from '../../images/xtremepapers.jpeg'


const IGCSE = () => {

  return (
    <>
        <Back title="IGCSE"/>

        <div className="search">
        <input placeholder="Search for IGCSE resources" value=""/>

        <img 
        src={searchIcon} 
        alt="search"/>
      </div>
      <div className="wrapper">
        < Card img={XtremePapers} title="XtremePapers" description="https://papers.xtremepape.rs/CAIE/IGCSE/"/>
      </div>
    </>

  )

}

export default IGCSE
